import React from 'react';
import { MenuList } from '../TextInfo';
import '../App.css';
import Swipe from '../components/Swipe';


const Events = () => {
    return (
        <span className="container_pages container_exp">
            <span>
                {MenuList.map( ( item, index ) => {
                    return <span>
                        <h1>{item.category}</h1>
                        {item.dish.map( ( dish, index ) => {
                            return <span>
                                {dish.set != null ?
                                    <span>
                                        <h3>{dish.set}</h3>
                                        {dish.desc.map( ( dishDesc, index ) => {
                                            return <p>{dishDesc}</p>
                                        } )}
                                    </span>

                                    : <span>
                                        <h5>{dish.name}</h5>
                                        {dish.desc != null ?

                                            dish.desc.map( ( dishDesc, index ) => {
                                                return <p>{dishDesc}</p>
                                            } )
                                            : null}
                                    </span>

                                }

                            </span>
                        } )}
                    </span>
                } )}
            </span>
        </span>
    );
}
export default Events
